import Photo01 from "../Assets/photo 01.jpg";
import './Hero.css';


const Hero = () => {
  return (
    <div className="Hero">
      <div>
      <img src={Photo01} alt="" />
      </div>
      <div className="content">
        <h2>"Capturing moments, creating memories," "Frame your life," or "Where art meets the lens"</h2>

      </div>
      
      
    </div>
  )
}

export default Hero
